(function() {
    'use strict';
    angular
        .module('sapo')
        .controller('ProductsNavigationController', ProductsNavigationController);
    ProductsNavigationController.$inject = ['ProductsResource', '$scope'];
    /* @ngInject */
    function ProductsNavigationController(ProductsResource, $scope) {
        var vm = this;
        $scope.image = "data:image/jpg;base64,";
        $scope.title = 'ProductsNavigationController';
        $scope.offset = 0;
        $scope.limit = 2;
        $scope.loading = true;
        ProductsResource.query({
            tenantId: 1,
            offset: $scope.offset,
            limit: $scope.limit
        }).$promise.then(function(result) {
            $scope.products = result;
            $scope.loading = false;
        });
        $scope.getProducts = getProducts;
        $scope.toggleListGrid = toggleListGrid;
        $scope.list = true;
        $scope.$emit('menuOption',"PRODUCTS_NAVIGATION"); 


        function getProducts() {
            $scope.loading = true;
            $scope.offset = $scope.offset + $scope.limit;
            ProductsResource.query({
                tenantId: 1,
                offset: $scope.offset,
                limit: $scope.limit
            }).$promise.then(function(result) {
                var productsAux = $scope.products.concat(result);
                $scope.products = productsAux;
                $scope.loading = false;
            });
        }
        
        function toggleListGrid(){ 
        	$scope.list=!$scope.list;
        	
        }





    }
})();